import React from 'react';
import 'react-social-icons';
import { SocialIcon } from 'react-social-icons';
import './style.css';

const footer = () => {
    return (
        <div className="footer-social">
            <SocialIcon url="https://www.linkedin.com/in/alen-sudec-0805641a0/"/>
        </div>
    )
}

export default footer;
